import { configureStore } from "@reduxjs/toolkit";
import cartReducer from './cart/reducer';
import bikeReducer from './bikes/reducer';
import { useReducer } from "react";

export const store = configureStore({
    reducer:{
        cart:cartReducer,
        bike:bikeReducer,
        auth:useReducer,
    }
})
